import TypingCustom from './TypingCustom'
import Link from 'next/link';
import Fade from 'react-reveal/Fade';
import Typing from 'react-typing-animation';


const Header = () => (
    <div className='outestdiv'>
        <div className='outerdiv'>
            <div className='inner_outerdiv'>
                <div className='titlelogo'>
                    <Link href='/'><a><h1>slern.io</h1></a></Link>
                </div>
                <ul className='navigation'>
                    <Link href='/about'><a><li>About</li></a></Link>
                    <Link href='/signin'><a><li>Sign In</li></a></Link>
                </ul>
            </div>
        </div >
        <div className='tagline'>
            <p>
                <span className='keyword'>for</span> <span className='variable'>cs_students</span> <span className='keyword'>by</span> <span className='variable'>cs_students</span>
            </p>
        </div>
        <style jsx>{`
        .tagline {
            text-align: center;
            padding-bottom: 50px;
            color: #486491;
            font-size: 40px;
            font-family: Courier; 
        }
        .keyword {
            font-weight: 700;
            color: #5A52FF;
        }
        .outerdiv {
            width: 100%;
            height: 50px;
            display: block;
            font-family: Arial; 
            font-size: 20px;
        }       
        .inner_outerdiv {
            width: 1000px;
            height: 100%;
            display: block;
            margin: 0 auto;

        }
        .titlelogo {
            color: #9B85F6;
            font-weight: bold;
            font-family: 'Arial';
            font-size: 30px;
            height: 100%;
            display: table;
            float: left;
        }
        .titlelogo h1{
                color: #218EEF;
                height: 100%;
                display: table-cell;
                vertical: middle;
                font-size: 80px;
        }
        .navigation {
            float: right;
            height: 100%;
            color: #9B85F6;
            font-family: 'Arial';
            list-style-type: none;
        }
        .navigation a{
            height: 100%;
            display: table;
            float: left;
            padding: 0px 20px;
        }
        a {
            text-decoration: none;
            font-family: 'Arial';
          }


        `}</style>
    </div >
);

export default Header;
